import { EgretLoadable } from "egret";
import ConstantList from "../../appConfig";
import { useTranslation, withTranslation, Trans } from 'react-i18next';
const ChiTietTour = EgretLoadable({
    loader: () => import("./ChiTietTour")
});
const ViewComponent = withTranslation()(ChiTietTour);

const ChiTietTourRoutes = [
    {
        path: ConstantList.ROOT_PATH + "chitiettour_manager/chitiettour",
        exact: true,
        component: ViewComponent
    }
];

export default ChiTietTourRoutes;
